// src/components/Navbar.jsx
import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const Navbar = ({ active }) => {
  return (
    <NavContainer>
      <NavLink to="/" $active={active === "home"}>Home</NavLink>
      <NavLink to="/aboutme" $active={active === "aboutme"}>About Me</NavLink>
      <NavLink to="/contact" $active={active === "contact"}>Contact</NavLink>
    </NavContainer>
  );
};

export default Navbar;

const NavContainer = styled.nav`
  position: relative;
  display: flex;
  justify-content: space-around;
  background-color: rgba(26, 126, 207, 0.6);
  padding: 10px;
  border-radius: 10px;
  margin-bottom: 20px;
`;

const NavLink = styled(Link)`
  text-decoration: none;
  color: ${({ $active }) => ($active ? "#1A7ECF" : "#FFFFF0")};
  font-size: 23px;
  font-family: "Dosis", sans-serif;
  font-weight: ${({ $active }) => ($active ? "bold" : "normal")};

  &:hover {
    font-weight: bold;
    font-style: italic;
  }
`;
